I can reproduce the debugger crash on the emulator and I've reported the crash to Apple. Taken from go mobile issue 19846, the LLDB Go operating system plugin can be disabled by putting:

`settings set plugin.os.goroutines.enable false`

into your  ~/.lldbinit.

However, I can't reproduce the problem on a real iOS device. I started from a blank Swift project, with this modification:

````
    import Geth

...

    func application(_ application: UIApplication, didFinishLaunchingWithOptions launchOptions: [UIApplicationLaunchOptionsKey: Any]?) -> Bool {
        // Override point for customization after application launch.
        let datadir = NSSearchPathForDirectoriesInDomains(.documentDirectory, .userDomainMask, true)[0]
        let ks = GethNewKeyStore(datadir+"/keystore", GethLightScryptN, GethLightScryptP);
        let newAcc = try! ks?.newAccount("Creation password")
        let bootnodes = GethNewEnodesEmpty()
        print("Done!")
        return true
    }
````

On my iPhone 5s, the console prints "Done!", as expected. I'm on macOS 10.12.6, and I've tried Xcode 8.3.2 as well as 8.3.3. I've tried both Go 1.8.1 and Go 1.9 (git tip). go-ethereum is at rev. 3d32690b54539d13ec8e7884bf3416ada6046354.

Thank you guys!

